function App() {
  return (
    <div>
      <h1>Environment Variables</h1>

      <p><b>Title:</b> {process.env.REACT_APP_TITLE}</p>
      <p><b>Version:</b> {process.env.REACT_APP_VERSION}</p>
    </div>
  );
}

export default App;
